int buggy_gcd(unsigned int u, unsigned int v,
	      int fix1, int fix2, int fix3){

  unsigned int s = 0;

  if(u == 0 || v == 0) return u | v;

  for(; ((u|v)&1) == 0; ++s){
    u >>= 1;
    v >>= 1;
  }

  while((u&1)==0)
    u >>= 1;

  do{
    while((v&1)==0)
      v >>= 1;
    if(u<=v){
      v-=u;
    }else{
      //unsigned int tmp = u >> 1; //fix: unsigned int tmp = u - v;
      fix1 = 1;
      //fix2 = -1;
      unsigned int tmp = u - fix2*v;
      u = v;
      v = tmp;
    }
    v >>= 1;
  }while(v!=0);
  
  return u<<s;
}

